import React from 'react'
import styled from "styled-components"
import NavBar from "./NavBar"

const Container = styled.div`
    width: 100%;
    height: 700px;
    background-color: #F6F9FC;
    font-family: 'Lato', sans-serif;
    color: #111439;
    padding-top: 20px;
`

export default function LandingSection () {
    return (
        <Container>
            <NavBar />
        </Container>
    )
}
